import React from "react";
import ExpenseItem from "./components/ExpenseItem";

const expenses = [
  {title: "Dry Cleaning", amount: 35.99, date: "10/20/2022"},
  {title: "Breakfast", amount: 5.75, date: "10/20/2022"},
  {title: "Lunch", amount: 7.53, date: "10/20/2021"},
  {title: "Light Bulbs", amount: 14.99, date: "10/20/2020"}
]
function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title}
      amount={expenses[0].amount} date={expenses[0].date} />
    </div>
  );
}
